import React, { Component } from 'react';
import axios from 'axios';
class User extends Component {
  state = {
    User: [],
  };
  componentDidMount() {
    axios
      .get('http://localhost:4000/userall')
      .then((response) => {
        console.log('first break point');
        this.setState({
          User: response.data,
        });
      })
      .catch((error) => {
        console.log(error);
      });
  }
  render() {
    return <></>;
  }
}

export default User;
